function scroll() {
  // кнопка вверх (нужно добавить стили в pageup.scss, если не отображается)
  var pageUp = document.querySelector('.pageup');
  window.addEventListener('scroll', function () {
    var scroll = Math.round(window.pageYOffset || document.documentElement.scrollTop);

    if (scroll > 800) {
      pageUp.classList.add('pageup-show');
    } else {
      pageUp.classList.remove('pageup-show');
    }
  }); // плавный скролл к блоку

  var navigationLinks = document.querySelectorAll('nav a');
  navigationLinks.forEach(function (link) {
    link.addEventListener('click', function (e) {
      e.preventDefault();
      var idLink = link.getAttribute('href');
      document.querySelector(idLink).scrollIntoView({
        behavior: 'smooth',
        block: 'start'
      });
    });
  });
}

